import React from "react";
import "./index.scss";
import queryString from "query-string";
import { connect } from "react-redux";
import { bindActionCreators } from "redux";
import {
  getDataProduct,
  getProductFilter,
  getDetailProduct,
} from "../../redux/action";

class DetailPage extends React.Component {
  componentDidMount() {
    const parsed = queryString.parse(window.location.search);
    const id = parsed.id;
    this.props.getDetailProduct(id);
    console.log(id, "id");
  }
  render() {
    console.log(this.props.id, "id");

    return <p>detailpage</p>;
  }
}

const mapsStateToProps = (state) => ({
  productFlashSale: state.productFlashSale,
  productRecommend: state.productRecommend,
  shopSenMall: state.shopSenMall,
  productTopKeyWord: state.productTopKeyWord,
  productFilter: state.productFilter,
  banner: state.banner,
  menu: state.menu,
  sitemap: state.sitemap,
  themeEvent: state.themeEvent,
});

const mapDispatchToProps = (dispatch) => ({
  ...bindActionCreators(
    {
      getDataProduct,
      getProductFilter,
    },
    dispatch
  ),
});
export default connect(mapsStateToProps, mapDispatchToProps)(HomePage);
